$(function(){obj={save_setting:function(){var e=Strack.validate_form("save_setting");200===e.status&&$.ajax({type:"POST",url:SettingsPHP.updateDefaultSetting,data:e.data,dataType:"json",beforeSend:function(){$.messager.progress({title:StrackLang.Waiting,msg:StrackLang.loading})},success:function(e){$.messager.progress("close"),200===parseInt(e.status)?Strack.top_message({bg:"g",msg:e.message}):layer.msg(e.message,{icon:7,time:1200,anim:6})}})}},$.ajax({type:"POST",url:SettingsPHP.getDefaultOptions,data:{options_field:"default_settings"},dataType:"json",success:function(e){$("#set_default_lang").combobox({url:SettingsPHP.getLangList,height:30,width:500,valueField:"id",textField:"name",value:e.default_lang}),$("#set_default_timezone").combobox({url:SettingsPHP.getTimezoneData,height:30,width:500,valueField:"val",textField:"zone",value:e.default_timezone}),$("#set_email").val(e.default_emailsuffix),$("#set_password").inputmask("*{8,96}").val(e.default_password),$("#set_op_password").val(e.default_admin_password)}})});